description:
The Resonance Project monthly conference call audio recordings offer a wide range of topics discussed by Nassim Haramein from the nature of consciousness, self-discovery, physics, ancient civilizations, UFO and extraterrestrial encounters, personal transformation, and many others. These calls are also a way for the general public to ask Nassim questions regarding any subject they wish. 

These collected works are a wonderful alternative to mainstream media and can alter the way you function in this Universe (if you so wish). 

